Here is a sample Spark job that calculates the hit rate for onsite attributed data:
```scala
import org.apache.spark.api.java.JavaRDD
import org.apache.spark.api.java.function.Function
import org.apache.spark.broadcast.Broadcast
import org.apache.spark.sql.SparkSession
import scala.collection.mutable.Map

object HitRateCalculator {
  def main(args: Array[String]): Unit = {
    val spark = SparkSession.builder().appName("HitRateCalculator").getOrCreate()

    // Load onsite attributed data
    val onsiteData: JavaRDD[(String, Long)] = spark.sparkContext.textFile("onsite_data.txt")
      .map(line => line.split("\t"))
      .map(arr => (arr(0), arr(1).toLong))

    // Load top frequent queries
    val topQueries: JavaRDD[String] = spark.sparkContext.textFile("top_queries.txt")

    // Broadcast top queries to all nodes
    val broadcastTopQueries: Broadcast[Array[String]] = spark.sparkContext.broadcast(topQueries.collect())

    // Initialize cache
    val cache: Map[String, (Long, Boolean)] = Map()

    // Process onsite data
    val hitRate = onsiteData.map(record => {
      val query = record._1
      val timestamp = record._2

      // Check if query is in top queries
      if (broadcastTopQueries.value.contains(query)) {
        // Check if query is in cache
        if (cache.contains(query)) {
          val (lastAccessTime, isCached) = cache(query)
          if (isCached && timestamp - lastAccessTime <= 12 * 60 * 60 * 1000) { // 12 hours in milliseconds
            // Cache hit
            (1, 1)
          } else {
            // Cache miss
            cache.put(query, (timestamp, true))
            (0, 1)
          }
        } else {
          // Cache miss
          cache.put(query, (timestamp, true))
          (0, 1)
        }
      } else {
        // Query not in top queries
        (0, 0)
      }
    }).reduce((a, b) => (a._1 + b._1, a._2 + b._2))

    // Calculate hit rate
    val hitRateValue = hitRate._1.toDouble / hitRate._2

    println(s"Hit rate: $hitRateValue")

    spark.stop()
  }
}
```
This job first loads the onsite attributed data and top frequent queries into JavaRDDs. It then broadcasts the top frequent queries to all nodes in the cluster. The cache is initialized as a mutable map.

The job then processes each record in the onsite attributed data. If the query is in the top frequent queries, it checks if the query is in the cache. If it is, it checks if the query is still cached (i.e., it has not been more than 12 hours since the last access). If it is still cached, it is a cache hit. Otherwise, it is a cache miss. If the query is not in the cache, it is also a cache miss.

The job keeps track of the number of cache hits and misses, and calculates the hit rate as the number of cache hits divided by the total number of queries in the onsite attributed data that are in the top frequent queries.

