To change the background color of an adaptive card in Microsoft Teams, you can use the "container" style property. However, please note that the background color of the entire card cannot be changed, only the background color of individual elements within the card.

Here's an example of how to change the background color of a container:

```json
{
    "type": "AdaptiveCard",
    "body": [
        {
            "type": "Container",
            "style": "emphasis",
            "items": [
                {
                    "type": "TextBlock",
                    "text": "This is some text"
                }
            ],
            "backgroundImage": {
                "url": "data:image/png;base64,iVBORw0KGg...."
            }
        }
    ],
    "actions": [],
